window.printOrder = async (orderId) => {
    try {
        const response = await fetch(`/api/os/${orderId}`, {
            method: 'GET',
            headers: {
                'Authorization': `Bearer ${document.cookie.split('sessionToken=')[1]}`
            }
        });

        if (!response.ok) {
            const errorText = await response.text();
            throw new Error(`Erro ao buscar ordem: ${response.status} - ${errorText}`);
        }

        const ordem = await response.json();

        // Garantir que o valor seja um número
        const valor = typeof ordem.valor === 'number' ? ordem.valor : parseFloat(ordem.valor);

        // Substituir vírgulas por <br> no campo serviço
        const servico = ordem.servico.replace(/,/g, '<br>');

        // Encontrar o nome do cliente no cache
        const cliente = window.clientesCache.find(cliente => cliente.id === ordem.idclie);
        const nomeCliente = cliente ? cliente.nome : 'Não disponível';

        // Adicionar lista de serviços
        const listaServicos = JSON.parse(ordem.lista_servicos || '[]');
        const listaServicosHtml = listaServicos.map(service => `
            <tr>
                <td>${service.name}</td>
                <td>R$${service.price.toFixed(2)}</td>
            </tr>
        `).join('');

        // Calcular o total dos serviços
        const totalServicos = listaServicos.reduce((total, service) => total + service.price, 0);

        // Substitua pelo Base64 da sua imagem
        const base64Image = 'data:image/png;base64,'; // Cole aqui a string Base64

        // Criar o conteúdo HTML para a impressão
        const orderHtml = `
            <html>
            <head>
                <title>Ordem de Serviço - ${ordem.os}</title>
                <style>
                    body { font-family: Arial, sans-serif; }
                    .order { width: 100%; margin: 0 auto; }
                    .order h1 { text-align: center; }
                    .order-table { width: 100%; border-collapse: collapse; margin-bottom: 20px; }
                    .order-table th, .order-table td { border: 1px solid #000; padding: 8px; text-align: left; }
                    .signature { margin-top: 40px; }
                    .signature div { margin-top: 20px; }
                    footer { font-size: 8px; color: #303030; text-align: center; padding: 10px; }
                </style>
            </head>
            <body>
                <div class="order">
                    <!-- Adicionar logo da empresa -->
                    <img src="${base64Image}" alt="Autotec" style="display: block; margin: 0 auto; width: 200px;">
                    <h1>Ordem de Serviço #${ordem.os}</h1>
                    
                    <table class="order-table">
                        <tr><th>Data</th><td>${new Date(ordem.data_os).toLocaleDateString()}</td></tr>
                        <tr><th>Carro</th><td>${ordem.carro}</td></tr>
                        <tr><th>Placa</th><td>${ordem.placa}</td></tr>
                        <tr><th>Técnico</th><td>${ordem.tecnico}</td></tr>
                        <tr><th>Valor</th><td>R$${valor.toFixed(2)}</td></tr>
                        <tr><th>Observação</th><td>${servico}</td></tr>
                        <tr><th>Cliente</th><td>${nomeCliente}</td></tr>
                    </table>
                    
                    <!-- Lista de Serviços -->
                    <h3>Lista de Serviços</h3>
                    <table class="order-table">
                        <thead>
                            <tr>
                                <th>Serviço</th>
                                <th>Preço</th>
                            </tr>
                        </thead>
                        <tbody>
                            ${listaServicosHtml}
                            <tr>
                                <td><strong>Total</strong></td>
                                <td><strong>R$${totalServicos.toFixed(2)}</strong></td>
                            </tr>
                        </tbody>
                    </table>
                    
                    <!-- Campo para assinatura do técnico -->
                    <div class="signature">
                        <div>Assinatura do Técnico:</div>
                        <div style="border-top: 1px solid #000; height: 50px; width: 200px;"></div>
                    </div>
                </div>
                <footer>
                    <p>AUTOTEC RACING SERVIÇOS AUTOMOTIVOS LTDA</p>
                    <p>CNPJ: 05.873.451/0001-57</p>
                    <p>RUA NARCISO STURLINI, 818, CENTRO, OSASCO - SP</p>
                </footer>
            </body>
            </html>
        `;

        // Criar uma nova janela para a impressão
        const printWindow = window.open('', '', 'width=800,height=600');
        printWindow.document.open();
        printWindow.document.write(orderHtml);
        printWindow.document.close();
        printWindow.focus(); // Necessário para alguns navegadores
        printWindow.print();
    } catch (error) {
        console.error('Erro ao imprimir ordem:', error);
    }
};
